- Restore all the Android contacts, videos, music, photos, SMS and more from computer. The exported html and txt files can be classified and displayed according to the date. By the way the contacts can be exported to your computer as VCF format. - Push music, photos and videos easily from computer to your phone. - Supports all Android phones, tablets and other devices running Android operating system. - You are allowed to search the wanted files during the transferring process.- The program can also fix the disconnecting problem between computer and the devices. 

